import React from 'react';
import {
  MDBCarousel,
  MDBCarouselInner,
  MDBCarouselItem,
  MDBContainer,
  MDBRow,
  MDBCol,
  MDBCard,
  MDBCardImage,
  MDBCardBody,
  MDBCardTitle,
  MDBCardText,
  MDBBtn,
} from 'mdbreact';
import {
  Grid,
  Typography,
  createMuiTheme,
  responsiveFontSizes,
  ThemeProvider,
  Paper,
} from '@material-ui/core';



const SimpleCarosel = () => {

  return (
    <MDBContainer>
      <MDBCarousel
        activeItem={1}
        length={1}
        slide={true}
        showControls={true}
        showIndicators={true}
        multiItem
      >
        <MDBCarouselInner>
          <MDBRow>
            <MDBCarouselItem itemId="1" >
              <Grid container direction="row" spacing={2} alignContent='space-around' style={{marginLeft:"10px"}}>
                <Grid item xs={12} md={2} >
                  <MDBCard className="mb-2">
                    <MDBCardImage
                      className="img-fluid"
                      src="data:image/png;base64,"
                    />
                  </MDBCard>
                </Grid>
                <Grid item xs={12} md={2}>
                  <MDBCard className="mb-2">
                    <MDBCardImage
                      className="img-fluid"
                      src="data:image/png;base64,"
                    />
                   
                  </MDBCard>
                </Grid>
                <Grid item xs={12} md={2}>
                  <MDBCard className="mb-2">
                    <MDBCardImage
                      className="img-fluid"
                      src="data:image/png;base64,"
                    />
                   
                  </MDBCard>
                </Grid>
                <Grid item xs={12} md={2}>
                  <MDBCard className="mb-2">
                    <MDBCardImage
                      className="img-fluid"
                      src="data:image/png;base64,"
                    />
                   
                  </MDBCard>
                </Grid>
                <Grid item xs={12} md={2}>
                  <MDBCard className="mb-2">
                    <MDBCardImage
                      className="img-fluid"
                      src="data:image/png;base64,"
                    />
                    
                  </MDBCard>
                </Grid>
                <Grid item xs={12} md={2}>
                  <MDBCard className="mb-2">
                    <MDBCardImage
                      className="img-fluid"
                      src="data:image/png;base64,"
                    />
                    
                  </MDBCard>
                </Grid>
              </Grid>
            </MDBCarouselItem>
           
            
          </MDBRow>
        </MDBCarouselInner>
      </MDBCarousel>
    </MDBContainer>
  );
};

export default SimpleCarosel;
